import { Box, Typography } from "@mui/material";
import React from "react";
import EditIcon from "../assets/location/EditIcon";
import AppBarTop from "../components/AppBarTop";
import { PADDING } from "../constants/Padding";
import { THEME } from "../constants/Theme";
import { useNavigate } from "react-router-dom";
import BasketIcon from "../assets/product/BasketIcon";
import Beras from "../assets/product/Beras.png";
import StarIcon from "@mui/icons-material/Star";

function Product() {
  const navigate = useNavigate();

  return (
    <Box
      sx={{
        width: "100%",
        display: "flex",
        flexDirection: "column",
        justifyContent: "flex-start",
        alignItems: "center",
      }}
    >
      <AppBarTop text={"Daftar Alamat"} line addBasket />
      <Box sx={{ width: PADDING - 10 }}>
        <Box sx={{ marginTop: "18px", alignItems: "center" }}>
          <Box sx={{ display: "flex", justifyContent: "center" }}>
            <img src={Beras} alt="product" width={"340px"} height={"247px"} />
          </Box>
          <Typography sx={{ fontSize: "18px", fontWeight: 500 }}>
            Beras Organik
          </Typography>
          <Box sx={{ display: "flex", mt: "7px" }}>
            <Box
              sx={{
                backgroundColor: "#f04454",
                width: "30px",
                height: "19px",
                borderRadius: "4px",
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
              }}
            >
              <Typography
                sx={{ color: "white", fontSize: "10px", fontWeight: 600 }}
              >
                20%
              </Typography>
            </Box>
            <Typography
              sx={{
                fontSize: "10px",
                color: "#A6A6A6",
                textDecoration: "line-through",
                marginLeft: "8px",
                marginTop: "2px",
              }}
            >
              55.000 / 5kg
            </Typography>
          </Box>
          <Typography
            sx={{
              fontSize: "14px",
              mt: "8px",
            }}
          >
            <span style={{ fontWeight: "bold" }}>45.000 </span>/ 5 kg
          </Typography>
          <Box sx={{ display: "flex", alignItems: "center", mt: "6px" }}>
            <Box sx={{ display: "flex", alignItems: "center" }}>
              <StarIcon sx={{ color: "#FFC431", fontSize: "9px" }} />
              <Typography
                sx={{
                  fontWeight: 400,
                  fontSize: "10px",
                  color: "#808386",
                  marginLeft: "3px",
                }}
              >
                4.5
              </Typography>
            </Box>
            <Box
              sx={{
                height: "9px",
                width: "1px",
                background: "#E8E8E8",
                mr: "5px",
                ml: "5px",
              }}
            />
            <Typography
              sx={{ fontWeight: 400, fontSize: "10px", color: "#808386" }}
            >
              Terjual 117
            </Typography>
          </Box>
        </Box>

      </Box>
      <Box sx={{width: '100%', height: '8px', background: "#FAFAFA", mt: '9px'}}/>
      <Box sx={{width: PADDING, background: 'red', display: 'flex', flexDirection: 'column'}}>
              <Box sx={{width: '160px'}}>
        <Typography sx={{fontSize: '16px', fontWeight}}>Deskripsi Produk</Typography>

            <Box sx={{display: 'flex', justifyContent: 'space-between'}}><Typography>Stok</Typography><Typography>12 Buah</Typography></Box>
            </Box>
      </Box>
    </Box>
  );
}

export default Product;
